import React, { Component } from "react";

export class NavigationButtons extends Component {
  render() {
    return (
      <div>
        <button onClick={() => props.setOpenHabit(true)}>NEW HABIT</button>
        <button>NEW HABIT</button>
        <button>NEW HABIT</button>
      </div>
    );
  }
}

export default NavigationButtons;
